import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for any "Your Profile" link using a text selector (first occurrence)
    const profileLink = await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });

    // Take screenshot before clicking
    const beforeClickShot = path.join(screenshotsDir, 'step_2_before_profile_click.png');
    await page.screenshot({ path: beforeClickShot });
    screenshots.push(beforeClickShot);

    // Click the "Your Profile" link (first visible one)
    await profileLink.click();

    // Wait for Jun's profile to appear by looking for the full name text
    // Use a text selector for "Jun Kim" (from junProfile.fullName)
    await page.waitForSelector('text=Jun Kim', { timeout: 5000 });

    // Take screenshot after navigation
    const afterProfileShot = path.join(screenshotsDir, 'step_3_after_profile.png');
    await page.screenshot({ path: afterProfileShot });
    screenshots.push(afterProfileShot);

    // Extract profile data: full name, username, bio
    const fullName = await page.textContent('h2:has-text("Jun Kim")');
    const username = await page.textContent('p.username');
    const bio = await page.textContent('p.bio');

    return {
      success: true,
      action: "Navigated to Jun's Profile and extracted profile information",
      extractedData: {
        fullName: fullName ? fullName.trim() : null,
        username: username ? username.trim() : null,
        bio: bio ? bio.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
